export const VehicleInput = (formik) => (
  <TextField
    error={Boolean(formik.touched.vehicleNumber && formik.errors.vehicleNumber)}
    fullWidth
    helperText={formik.touched.vehicleNumber && formik.errors.vehicleNumber}
    label="Vehicle Number"
    name="vehicleNumber"
    onBlur={formik.handleBlur}
    onChange={(event) => {
      formik.setFieldValue(`vehicleNumber`, event.target.value.toUpperCase);
    }}
    value={formik.values.vehicleNumber}
    variant="outlined"
    inputProps={{ style: { textTransform: "uppercase" } }}
    InputProps={{
      inputComponent: vehicleNumberFormatter,
    }}
  />
);
